# Your code here
import pandas as pd
import numpy as np
import seaborn as sns
import matplotlib.pyplot as plt
import calendar

# load flight data in
wildlife_df = pd.read_csv("/content/drive/MyDrive/2021_Fall_USF_PMS_Biotechnology/MSDS_596/data/wildlifestrikes.csv") #, index_col="Record ID")
wildlife_df.describe()

# explore data columns
wildlife_df.info()

# explore data
wildlife_df.head()

# count number of incidents per operator
wildlife_df["Operator"].value_counts()

# number of accidents per each year
wildlife_df["Incident Year"].value_counts()

# select data of certain columns
select_col=['Record ID', 'Incident Year', 'Incident Month', 'Incident Day', 'Operator', 'Species Name', 'Aircraft', 'State']
wildlife_select_df = wildlife_df[select_col]
wildlife_select_df.head()

# explore number of accidents for each month
wildlife_select_df['Incident Month'].value_counts()

# quick exploratory graph for all incidents per month
wildlife_select_df.groupby('Incident Month')['Record ID'].count().plot.line()

# create bins for 10 year incriments bins
ten_year_bins = np.arange(1990, 2030, 10)
labels=[]
list_bins = list(np.arange(1990, 2020, 10))

#create list for labels 
for element in list_bins:
  i = str(element)+'s'
  labels.append(i)

# create year bins
wildlife_select_df['Decades'] = pd.cut(x=wildlife_select_df['Incident Year'], 
                                       bins=ten_year_bins,
                                       labels = labels,
                                       include_lowest =True)
wildlife_select_df.head()

# exploratory graph of number of incidents over the years
wildlife_select_df.groupby('Incident Year')['Record ID'].count().plot.line()

# convert data to decades. months and total number of incidents
wildlife_decade_df = wildlife_select_df.groupby(by=["Decades", "Incident Month"], as_index=False)['Record ID'].count()
wildlife_decade_df.rename(columns={'Record ID': '# of Incidents'}, inplace=True)
wildlife_decade_df

# get the name of the months as abbriviations
months_short = wildlife_decade_df['Incident Month'].apply(lambda x: calendar.month_abbr[x])

# Chart
sns.set_theme(style="white")
chart1 = sns.relplot(kind="line", 
                     data=wildlife_decade_df, 
                     x=months_short, 
                     y='# of Incidents',
                     hue="Decades",
                     height=5, 
                     aspect=2,
                     palette={
                         '1990s': '#2cbdfe',
                         '2000s': '#6379de',
                         '2010s': '#b01bb3'},
                     linewidth=4,
                     legend=False)

chart1.set(ylim=(0,12000), 
           xlabel=None)

# set axis object for the custom text
ax = chart1.axes[0,0]

# text annotation
ax.text(x=7.5, y=5800, s='1990s', size='large', color='#2cbdfe', weight='semibold')
ax.text(x=7.5, y=11000, s='2000s', size='large', color='#6379de', weight='semibold')
ax.text(x=7.5, y=8700, s='2010s', size='large', color='#b01bb3', weight='semibold')

# fix title, axis labels and ticks
plt.title('Total # of Incidents Through Decades', fontsize=20, x=0.32)
plt.ylabel('# of Incidents', fontsize=18)
plt.xticks(months_short, fontsize=14)
plt.yticks(fontsize=14)

plt.show()

